import { keyboard } from '@testing-library/user-event/dist/keyboard'
import React from 'react'
import { items } from './seo'
// import './App.css'
import { ReactSearchAutocomplete } from 'react-search-autocomplete'

function App() {
  // note: the id field is mandatory
  // const items = [
